    }
    return (
        <div className="rightBarContainer">
            <div className="rightBarWrapper">
                <div className="birthdayContainer">
                <CardGiftcardIcon className="birthdayImg" htmlColor="#ff6633"/>
                <span className="birthdayText"><b>Elias Admaso</b> and <b>4 other people</b> have a birthday today</span>
                </div>
                <img className="rightBarAd" src="https://learnenglish.britishcouncil.org/sites/podcasts/files/RS8084_GettyImages-722228867-hig.jpg"/>
                <h4 className="rightBarTitle">Online Friends</h4>
                <ul className="rightBarFriendsList">
                    {Users.map((user)=>{
                        return(<Online user={user}/>)
                    })}

                </ul>

            </div>

        </div>
    )
}

export default RightBar
